<html>
<head>
</head>
  <style>
    body {
      text-align: center;
      margin: 0;
      background-color: #FAB1A0;
      animation-name: to_purple, to_nude, to_green, to_blue;
      animation-duration: 3s, 3s, 3s, 3s;
      animation-timing-function: ease-out, ease-out, ease-out, ease-out;
      animation-fill-mode: forwards, forwards, forwards, forwards;
      animation-iteration-count: 1, 1, 1, 1;
      animation-delay: 3s, 7s, 10s, 14s;
    }
    #wrapper {
      width: 100%;
      height: 100%;
      text-align: center;;
    }
    #bg_image {
      width: 100%;
      position: absolute;
      top: 0;
      left: 0;
      z-index: -1;
    }
    #content {
      margin: auto;
      height: 100%;
    }
    #content svg {
      margin-top: 10%;
    }

    /* BG Animations */

    @keyframes to_rosepink {
      0% {
      }
      10% {
        background-color: #FAB1A0;
      }
      100% {
        background-color: #FAB1A0;
      }
    }
    @keyframes to_purple {
      0% {
        background-color: #FAB1A0;
      }
      10% {
        background-color: #AE7EAF;
      }
      100% {
        background-color: #AE7EAF;
      }
    }
    @keyframes to_nude {
      0% {
        background-color: #AE7EAF;
      }
      10% {
        background-color: #B28F95;
      }
      100% {
        background-color: #B28F95;
      }
    }
    @keyframes to_green {
      0% {
        background-color: #B28F95;
      }
      10% {
        background-color: #6DC49E;
      }
      100% {
        background-color: #6DC49E;
      }
    }
    @keyframes to_blue {
      0% {
        background-color: #6DC49E;
      }
      10% {
        background-color: #186A93;
      }
      100% {
        background-color: #186A93;
      }
    }

    /* SVG Animations */

      #shop_2, #shop_3, #shop_4, #shop_5{
        visibility: hidden;
      }
      #shop_2_text, #shop_3_text, #shop_4_text, #shop_5_text {
        opacity: 0;
      }
      #shop_1 {
        animation-name: slide_up;
        animation-duration: 1s;
        animation-timing-function: ease-out;
        animation-fill-mode: forwards;
        animation-iteration-count: 1;
        animation-delay: 3s;
      }
      #shop_2 {
        animation-name: queue, slide_up_stay, slide_up;
        animation-duration: .1s, 1s, 1.5s;
        animation-timing-function: none, ease-in, ease-out;
        animation-fill-mode: forwards, forwards, forwards;
        animation-iteration-count: 1, 1, 1;
        animation-delay: .1s, 2.85s, 6.5s;
      }
      #shop_2_text {
        animation-name: text_appear;
        animation-duration: 1s;
        animation-timing-function: ease-out;
        animation-fill-mode: forwards;
        animation-iteration-count: 1;
        animation-delay: 3.3s;
      }
      #shop_3 {
        animation-name: queue, slide_up_stay, slide_up;
        animation-duration: .1s, 1s, 1.5s;
        animation-timing-function: none, ease-in, ease-out;
        animation-fill-mode: forwards, forwards, forwards;
        animation-iteration-count: 1, 1, 1;
        animation-delay: .1s, 6.45s, 10s;
      }
      #shop_3_text {
        animation-name: text_appear;
        animation-duration: 1s;
        animation-timing-function: ease-out;
        animation-fill-mode: forwards;
        animation-iteration-count: 1;
        animation-delay: 7s;
      }
      #shop_4 {
        animation-name: queue, slide_up_stay, slide_up;
        animation-duration: .1s, 1s, 1.5s;
        animation-timing-function: none, ease-in, ease-out;
        animation-fill-mode: forwards, forwards, forwards;
        animation-iteration-count: 1, 1, 1;
        animation-delay: .1s, 9.98s, 13.5s;
      }
      #shop_4_text {
        animation-name: text_appear;
        animation-duration: 1s;
        animation-timing-function: ease-out;
        animation-fill-mode: forwards;
        animation-iteration-count: 1;
        animation-delay: 10.4s;
      }
      #shop_5 {
        animation-name: queue, slide_up_stay;
        animation-duration: .1s, 1s;
        animation-timing-function: none, ease-in;
        animation-fill-mode: forwards, forwards;
        animation-iteration-count: 1, 1;
        animation-delay: .1s, 13.48s;
      }
      #shop_5_text {
        animation-name: text_appear;
        animation-duration: 1s;
        animation-timing-function: ease-out;
        animation-fill-mode: forwards;
        animation-iteration-count: 1;
        animation-delay: 14s;
      }
      @keyframes slide_up {
        0% {
          visibility: visible;
          transform: translateY(0);
        }
        100% {
          visibility: visible;
          transform: translateY(-100%);
        }
      }
      @keyframes slide_up_stay {
        0% {
          visibility: visible;
          transform: translateY(100%);
        }
        100% {
          visibility: visible;
          transform: translateY(0);
        }
      }
      @keyframes queue {
        0% {
          transform: translateY(0);
        }
        100% {
          transform: translateY(100%);
        }
      }
      @keyframes text_appear {
        0% {
          opacity: 0;
          transform: translateY(5%);
        }
        40% {
          opacity: 1;
          transform: translateY(-1%);
        }
        100% {
          opacity: 1;
          transform: translateY(0);
        }
      }
  </style>
